html, body, .orbit-page {
    width: 100%;
    height: 100%;
    overflow: hidden;
}
h1 {
    margin: 0;
}
html {
    font-size: 62.5%;
    -webkit-tap-highlight-color: transparent;
}
body {
    background-image: url(/page-bgs/Stars-bg.svg
    );
}
@font-face {
    font-family: 'Voyager-heavy';
    src: url('/fonts/Voyager\ Heavy\ Webfont.woff') format('woff');
}
@font-face {
    font-family: 'Voyager-light';
    src: url('/fonts/Voyager\ Light\ Webfont.woff') format('woff');
}
@font-face {
    font-family: 'Prototype';
    src: url('/fonts/Prototype.woff') format('woff');
}

a {
    text-decoration: none;
