//the section below is the css for the entire MOBILE landing page//
.orbit-page {
    display: flex;
    flex-direction: column;
    height: 100%;
    width: 100%;
    
    .shuttle {
        z-index: 999;
        display: flex;
        align-items: center;
        justify-content: center;
        width: 3rem;
        height: 3rem;
        align-self: center;
    }
    .nav-container {
        z-index: 9999;
        flex: .2;
        margin-top: 8%;
        width: fit-content;
        height: auto;
        display: flex;
        flex-direction: row;
        padding-left: 10px;
        
        .nav-list {
            padding: 1rem;
            line-height: 4rem;
        }
        
        .nav-item {
            width: auto;
            color: #fff;
            list-style-type: none;
            font-size: 1.6rem;
            letter-spacing: 1px;
            font-family: 'voyager-light';
        }
    }
        
    .travel-container { //adds onto the styles from the original nav element for subsequent pages//
        align-self: center;
        padding-left: 0px;
        flex-basis: 25%;
        margin: 5% 0 0 0;
        
        
        .travel-list  {
            padding: 0;
            line-height: 4.5rem;
        }
        
        .travel-item {
            text-align: center;
            font-size: 1.6rem;
        }
    }
        
        
    .celestial-body-container {
            display: flex;
            flex-direction: column;
            justify-content: flex-end;
            align-items: center;
            position: absolute;
            align-self: flex-end;
            width: 18rem;
            height: 20%;

        .moon {
            margin-bottom: 4rem;
        }
    }
     li {
        width: fit-content;
     }
    .name-container {
        flex-basis: 75%;
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: center;
        flex-wrap: wrap;
        font-family: voyager-heavy;
        margin-bottom: 15%;
    }
    .header-container{
        padding-bottom: .75rem;
    }

    .main-header-text {
        
        text-align: center;
        letter-spacing: 3px;
        font-size: 3rem;
        color: #fff;
    }
    .occupation-container {
        padding-bottom: 1rem;
    }
    .occupation-header-text {
        font-size: 1.5rem;
        color: #fff;
    }
   
      
    .typed {
        overflow: hidden;
        white-space: nowrap;
        border-right: 2px solid;
        width: 0;
        animation: typing 1.5s steps(30, end) forwards, blinking .75s infinite;
    }
    

    .copyright-footer {
        flex: .05;
        display: flex;
        justify-content: center;
        align-items: center;
    }    
    .copyright {
        color: #fff;
        font-family: 'voyager-light';
        font-size: .5rem;
    }
}

//the section below is for the entire PROJECTS-MOBILE page

.section-title {
    flex-basis: 22%;
}
.flex-layout-projects {
    flex-basis: 75%;
    display: flex;
    flex-direction: column;
    height: 100%;
    width: 100%;
    align-items: center;
    justify-content: center;
}
.section-title-container {
    border: 2px solid white;
    width: fit-content;
    height: fit-content;
    padding: 8px;
    margin: 5% 0 0 5%;
}

.section-title-text {
    font-size: 1.8rem;
    font-family: voyager-light;
    color: #fff;
    letter-spacing: 1px;
    text-align: center;
}

.lander-body {
    display: flex;
    flex-direction: column;
    width: 39%;
    height: 39%;
}
        .lander {
            position: absolute;
            align-self: end;
            width: 4rem;
            height: 4rem;
            margin: -2rem -1.5rem 0 0 ;
        }
        .celestial-body {
            width: 7rem;
            height: 7rem;
        }
        
.lander-text-container {
    width: auto;

