        font-size: .8rem;
        color: #fff;
        font-family: voyager-light;
        letter-spacing: 0;
        margin: 0;
         }
        .lander-text-desktop {
            display: none;
        }
    }



.projects-container {
    flex-basis: 75%;
    display: grid;
    grid-template-columns: 1fr 1fr;
    grid-template-rows: repeat(3, 1fr);
    justify-items: center;
    align-items: center;
    height: 100%;
    width: 100%;

    .projects-border {
        display: flex;
        align-items: center;
        justify-content: center;
        position: relative;
        z-index: 2;
