        -webkit-clip-path: polygon(8% 0%, 92% 0%, 100% 12%, 100% 84%, 92% 100%, 8% 100%, 0% 84%, 0% 12%);
        clip-path: polygon(8% 0%, 92% 0%, 100% 12%, 100% 84%, 92% 100%, 8% 100%, 0% 84%, 0% 12%);
        grid-column: 1/3;
    }
    .project-item {
        display: flex;
        justify-content: center;
        opacity: 1;
        z-index: 1;
        -webkit-clip-path: polygon(8% 0%, 92% 0%, 100% 12%, 100% 84%, 92% 100%, 8% 100%, 0% 84%, 0% 12%);
        clip-path: polygon(8% 0%, 92% 0%, 100% 12%, 100% 84%, 92% 100%, 8% 100%, 0% 84%, 0% 12%);
        width: 98%;
        height: 97%;
        background-image: url(/assets/pixels.svg);
