            font-size: 2rem;
            position: absolute;
            align-self: center;
            font-family: voyager-heavy;
            font-weight: bold;
            color: white;
        }
        .project-title-desc {
            font-size: 1.2rem;
            letter-spacing: 1px;
            position: absolute;
            align-self: center;
            font-family: prototype;
            color: white;
            margin-top: 6rem;
        }
    }
    
    .projects-image {
        opacity: .2;
        width: 25rem;
        height: 15rem;
    }
    
    
}
.overlay {
    display: flex;
    justify-content: center;
    align-items: center;
    width: 100%;
    height: 100%;
    background: #6f0000;
    position: absolute;
    opacity: 0;
    -webkit-transition: all 1s ease-in-out;
    -moz-transition: all 1s ease-in-out;
    -ms-transition: all 1s ease-in-out;
    -o-transition: all 1s ease-in-out;
    transition: all .3s ease-in-out;

    .overlay-layout {
        display: flex;
        width: 90%;
        height: 95%;
    }

    .overlay-text {
        align-self: center;
        margin: 0;
        color: white;
        font-size: 1.2rem;
        letter-spacing: 1px;
        font-family: prototype;
        flex-basis: 80%;
        
    }
    .code-links {
        flex-basis: 20%;
        display: flex;
        align-items: center;
        justify-content: center;
        flex-direction: column;
        margin-bottom: .5rem;
        gap: .5rem;

        .code-icon {
            width: 5rem;
            height: 5rem;
        }
    }
}



.project-item:hover {
    background-color: black;
}
.shuttle-travel {
    rotate: 90deg;
    margin-left: 14rem;
}
.shuttle-trail::before {
    content: '';
    z-index: 1;
    margin-top: 19.25rem;
    position: relative;
    left: 60%;
    transform: translateX(-50%);
    width: 10px;
    height: 150px;
    background: linear-gradient(#00d0ff, transparent);
}

li {
