//the section below is for the rocketship animation

@keyframes rumble {
    0% {-webkit-transform: rotate(0deg);}
    25% {-webkit-transform: translate(2px, 0px) rotate(-3deg);}
}
@keyframes rumble-travel {
    0% {-webkit-transform: rotate(0deg);}
    25% {-webkit-transform: translate(3px, -2px);}
    50% {-webkit-transform: translate(3px, 3px);}
}

.shuttle-travel {
    animation: rumble-travel 5s infinite ease-in-out
}

#rumble-hover:hover #shuttle{
    animation: rumble .0625s infinite linear;
}

@keyframes slide-up {
    from {
      transform: translatey(0%);
    }
    to {
      transform: translatey(-1000%);
    }
}
@keyframes slide-right {
    from {
      transform: translatey(0%);
    }
    to {
      transform: translatey(-2000%);
    }
}
@keyframes slide-up-right{
    from {
      transform: translate(0, 0);
    }
    to {
      transform: translate(1000%, -1000%);
    }
}
.shoot-off-back {
    animation: slide-up-right .15s;
    animation-fill-mode: forwards;
}
.shoot-off {
    animation: slide-up .15s ;
    animation-fill-mode: forwards;
}
.shoot-off-right {
    animation: slide-right .15s;
    animation-fill-mode: forwards;
}
.shoot-off::before {
    content: '';
    z-index: 1;
    margin-top: 19.25rem;
    position: relative;
    left: 60%;
    transform: translateX(-50%);
    width: 10px;
    height: 150px;
    background: linear-gradient(#00d0ff, transparent);
}

//the code below is for the floating animations for the mobile-version
@keyframes float {
    0% {
        transform: translatey(0px);
        transform: translateX(0px);
    }
    50% {
        transform: translatey(5px);
    }
    100% {
        transform: translatey(0px);
    }
}
@keyframes float-light {
    0% {
        transform: translatey(0px);
        transform: translateX(0px);
    }
    50% {
        transform: translatey(8px);
    }
    100% {
        transform: translatey(0px);
    }
}
@keyframes float-asteroid {
    0% {-webkit-transform: rotate(0deg);}
    50% {-webkit-transform: translate(15px,25px) rotate(20deg);}
}

.celestial-body-container {
    animation: float 9s infinite linear;
}
.shuttle-idle {
    animation: float 7s infinite linear;
}
.asteroid {
    animation: float-asteroid 30s infinite ease-in-out;
}

    
@keyframes typing {
    from { width: 0 }
    to { width: 100% }
}
@keyframes blinking {
      0% {border-color: white}
    50% {border-color: transparent}
}

