    .section-title-text {
        font-size: 1.4rem;
    }
    .overlay {
        .overlay-layout {
            height: 65%;
            .overlay-text {
                font-size: 1rem;
            }
            .code-icon {
                width: 3rem;
                height: 3rem;
            }
        }
    }
    .dev-desc-text {
        font-size: 1.4rem;
    }
    .gag-joke {
        font-size: 1.2rem;
        margin-top: .5rem;
    }
}


//media queries for ipads and larger screens
@media only screen and (min-width: 700px) {
    //general queries for general page layout
    .section-title-container {
        margin: 8% 0 0 8%;
    }
    .section-title-text {
        font-size: 2.4rem;
    }

    .celestial-body-container {
        margin-right: 5%;
        width: 22rem;

        .lander-body {
            width: 45%;
            height: 45%;
        }
        .celestial-body {
            width: 8rem;
            height: 8rem;
        }
        .lander {
            margin: -2rem -1rem 0 0;
        }
        .lander-text {
            font-size: 1rem;
        }
    }

    //projects media query for ipads
    .projects-container {
        width: 80%;
        align-self: center;
        .overlay {
            .overlay-layout {
                padding-left: 5%;
                width: 80%;
        
                .code-links {
                    align-items: flex-start;
                    margin-left: 2rem;
                }
                .overlay-text {
                    font-size: 1.6rem;
                    line-height: 2rem;
                }
            }
        }
    }
    //section below is for the skills section for the ipad and other large screens
    .asteroids-container {
        height: 60%;
        grid-template-columns: repeat(16, 1fr);
        grid-template-rows: repeat(6, 1fr);
        .asteroid:nth-child(1n) {
            .skill {
                width: 4rem;
                height: 4rem;
            }
        }
        .asteroid:nth-child(2n) {
            .skill {
                width: 5rem;
                height: 5rem;
            }
        }
        .asteroid:nth-child(3n) {
            .skill {
                width: 6rem;
                height: 6rem;
            }
        }
        .asteroid:nth-child(4n) {
            grid-column: 6/8;
            grid-row: 4/7;
            .skill {
                width: 4rem;
                height: 4rem;
            }
        }
        .asteroid:nth-child(6n) {
            grid-column: 3/6;
            grid-row: 4/7;
            .skill {
                width: 7rem;
                height: 7rem;
                rotate: 30deg;
            }
        }
        .asteroid:nth-child(7n) {
            .skill {
                width: 7rem;
                height: 7rem;
                rotate: 30deg;
            }
        }
        .asteroid:nth-child(8n) {
            grid-column: 10/13;
            grid-row: 9/12;
            .skill {
                width: 6rem;
                height: 6rem;
                rotate: 20deg;
            }
        }
        .asteroid:nth-child(9n) {
            grid-column: 10/13;
            grid-row: 5/8;
        }
        .asteroid:nth-child(10n) {
            grid-column: 13/16;
            grid-row: 6/9;
            .skill {
                width: 6rem;
                height: 6rem;
            }
        }
        .asteroid:nth-child(11n) {
            grid-column: 12/14;
            grid-row: 4/6;
            .skill {
                width: 5rem;
                height: 5rem;
            }
        }
        .asteroid:nth-child(12n) {
            grid-column: 15/17;
            .skill {
                width: 6rem;
                height: 6rem;
            }
        }
        .asteroid:nth-child(13n) {
            .skill {
                width: 6rem;
                height: 6rem;
            }
        }
    }
    //section below is for the developer debriefing section for ipads and other large screens
    .dev-text:nth-child(1n) {
        font-size: 2rem;
    }
    .dev-desc-border {
        width: 85%;
        height: 100%;
    }
    .dev-text-container {
        padding: 0 1rem 0 1.5rem;
    }
    .dev-desc-text {
        font-size: 2.2rem;
        letter-spacing: 1px;
        line-height: 3rem;
    }
    .gag-joke {
        font-size: 2rem;
        margin-top: 1rem;
    }
    //the section below is for the contact page for ipad and larger screens
    .social-link {
        width: 10.5rem;
        height: 10.5rem;
        .indeed {
            width: 9.5rem;
            height: 9.5rem;
        }
        .resume {
            width: 9.5rem;
            margin-left: .75rem;
        }
    }
    .form-container {
        width: 75%;
        padding: 2rem 1rem 0 1rem;
        grid-template-rows: repeat(11, 4rem);
        textarea {   
        grid-row: 4/11;
        }
        .contact-name, .contact-email, .contact-subject {
            height: 2.5rem;
            font-size: 1.2rem;
            font-family: prototype, sans-serif;
        }
        textarea {
            font-size: 1.4rem;
            font-family: prototype, sans-serif;
        }
        .label-email, .label-subject {
            margin-left: 10%;
        }
        .label-name {
            width: 70%;
            justify-self: flex-start;
            margin-left: 10%;
        }
        .imperial-crest {
            margin-right: 6rem;
        }
        .label-email,.label-name,.label-subject {
            font-size: 1.4rem;
            font-family: voyager-light, Arial, Helvetica, sans-serif;
            flex-wrap: nowrap;
        }
        .contact-btn {
            grid-row: 11/12;
        }
    }
}

@media only screen and (min-width: 1000px) {
    .dev-desc-text {
        font-size: 2.6rem;
        line-height: 4rem;
    }
    .lander-text-container {
        .lander-text {
            font-size: 1.6rem;
        }
    }
    .orbit-page {
        .nav-container {
            .travel-list, .nav-list {
                line-height: 6rem;
            }
            .nav-item {
                font-size: 2.6rem;
            }
        }
    }
    .form-container {
        grid-template-rows: repeat(11, 5.5rem);
        .contact-btn {
            width: 7rem;
            height: 7rem;
        }
    }
}


@media only screen and (min-width: 1030px) {

    body {
        display: flex;
        align-items: center;
        justify-content: center;
    }
    @keyframes rumble {
        0% {-webkit-transform: rotate(0deg);}
        25% {-webkit-transform: translate(2px, 0px) rotate(-3deg);}
    }
    
    #rumble-hover:hover #shuttle{
        animation: rumble .0625s infinite linear;
    }

    .orbit-page {
        max-width: 2250px;
        .nav-container {
            margin-top: 2%;
            margin-left: 2%;
            gap: 2%;
            .nav-links {
                display: flex;
                gap: 8%;
            }
            li {
                white-space: nowrap;
                
            }
            
            .nav-item {
                font-size: 2rem;
            }
        }
        .celestial-body-container {
            margin-top: 4.5rem;
            .moon {
                width: 100%;
                max-width: 10rem;
                margin-bottom: 0;
            }
        }
        .main-header-text {
            font-size: 3.8rem;
        }
        .occupation-header-text {
            font-size: 1.8rem;
        }
        .main-page-links {
            img {
                display: inline-block;
                width: 5rem;
                height: 5rem;
            }
        }
        
    }
    //code below is for the projects section
    .section-title-container {
        margin: 5% 0 0 3%;

        .section-title-text {
            font-size: 3rem;
        }
    }
    .projects-border {
        max-width: 80%;
        .project-item {
            .project-heading {
                font-size: 2.8rem;
            }
            .project-title-desc {
                font-size: 1.8rem;
                margin-top: 8rem;
            }
        }
    }
    .flex-layout-projects {
        flex-direction: row;
        align-items: center;
        .projects-container {
            flex-basis: 85%;
        }
        .travel-container {
            flex-basis: 30%;
            margin: 0;
            .travel-links {
                flex-direction: column;
            }
        }
      .overlay {
        .overlay-layout {
            padding-left: 3rem 2rem 3rem 2rem;
            .overlay-text {
                font-size: 1.6rem;
                line-height: 3.5rem;
            }
        }
      }
      .overlay:hover {
        cursor: pointer;
      }
    }
    //code below is for the skills desktop section 
    .asteroids-container {
        flex-basis: 85%;
        width: 100%;
        max-width: fit-content;
        grid-template-columns: repeat(12, 1fr);
        grid-template-rows: repeat(8, 1fr);
        margin-bottom: 10%;
        
        .asteroid {
            max-width: 15rem;
            max-height: 20rem;
            grid-column: 11/13;
            grid-row: 7/9;
        }
        
        .asteroid:nth-child(2n) {
            grid-column: 9/11;
            grid-row: 7/9;
            rotate: 30deg;
        
            .skill2 {
                width: 4rem;
                margin-right: 1rem;
            }
        }
        .asteroid:nth-child(3n) {
            grid-column: 9/11;
            grid-row: 2/4;
            rotate: 5deg;
        
            .skill3 {
                margin-top: .5rem;
                width: 5rem;
                rotate: 20deg;
            }
            
        }
        .asteroid:nth-child(4n) {
            grid-column: 8/10;
            grid-row: 3/6;
            rotate: -8deg;
        
            .skill4 {
                width: 6rem;
            }
        }
        .asteroid:nth-child(5n) { //this is the alien
            grid-column: 11/13;
            grid-row: 5/7;
            rotate: 30deg;
        
            
        }
        .asteroid:nth-child(6n) {
            grid-column: 7/8;
            grid-row: 6/8;
            rotate: 40deg;
        
            .skill5 {
                width: 5rem;
                background-color: #fff;
            }
        }
        .asteroid:nth-child(7n) {
            grid-column: 7/8;
            grid-row: 2/4;
            rotate: 30deg;
        
        }
        .asteroid:nth-child(8n) {
            grid-column: 6/7;
            grid-row: 4/6;
            rotate: 21deg;
        
            .skill7 {
                margin-top: 1rem;
                width: 2.5rem;
            }
        }
        .asteroid:nth-child(9n) {
            grid-column: 5/6;
            grid-row: 2/3;
            rotate: 34deg;
            .skill8 {
                margin-right: 1rem;
                width: 5rem;
                rotate: 30deg;
            }
        }
        .asteroid:nth-child(10n) {
            grid-column: 5/6;
            grid-row: 7/8;
            rotate: 34deg;
            .skill9 {
                width: 5rem;
            }
        }
        .asteroid:nth-child(11n) {
            grid-column: 4/5;
            grid-row: 4/7;
            rotate: 34deg;
        
            .skill10 {
                width: 6rem;
                height: 6rem;
                rotate: 15deg;
            }
        }
        .asteroid:nth-child(12n) {
            grid-column: 3/5;
            grid-row: 2/3;
            rotate: 90deg;
        
            .skill11 {
                width: 6rem;
                rotate: -60deg;
            }
        }
        .asteroid:nth-child(13n) {
            grid-column: 2/3;
            grid-row: 4/7;
            .skill12 {
                width: 4rem;
            }
        }
    }
    //section below is for the dev debrief section
    .dev-info-container {
        grid-template-rows: repeat(12, 8%);
        height: 100%;
        margin: 0;
        gap: 2rem;
        .dev-desc-border {
            max-width: 1000px;
            grid-row: 4/13;
            height: fit-content;
        }
        .dev-desc-text {
            font-size: 2.4rem;
            line-height: 3.5rem;
        }
    }

    //the section below is for the contact section for the desktop
    .contact-container {
        order: 2;
    }
    .email-container {
        flex-basis: 75%;
        width: 60%;
        height: 85%;
        margin-left: 5%;
    }
    .form-container {
        width: 100%;
        .imperial-crest {
            margin-right: 3rem;
        }
    }
    textarea {
        height: 75%;
    }
    .social-links-container {
        margin-bottom: 5rem;
    }
}
